import React from "react";
import "./footer.css";

const Footer = () => {
  return (
    <footer>
      <div className="footer-content">Section 1</div>
      <div className="footer-content">Section 2</div>
      <div className="footer-content">Section 3</div>
    </footer>
  );
};

export default Footer;
